function UserProfile(props) {
    return(
        <div style={{width: "70%", marginLeft: '20%', marginRight:'10%'}}>
            <img className="w-full h-full opacity-20" style={{filter:'blur(8px)'}} src={props.profile} />
        </div>
    )
}

export default UserProfile;
